<h1>Open URLs</h1>
<h2>Открыть одну или несколько ссылок одновременно</h2>
<p>Скопируйте и вставьте в поле список ссылок (по одному URL в строке). 
Нажмите кнопку "Открыть все URL" — все ссылки откроются одновременно в новых вкладках вашего браузера.</p>
